define({"topics" : [{"title":"Importing Zephyr test cases into <span class=\"ph\">TestArchitect</span>","shortdesc":"\n                     <p class=\"shortdesc\">Test cases residing on Zephyr can be imported into <span class=\"ph\">TestArchitect</span>, which also establishes one-to-one mappings         between the two sets of test cases.\n                     </p>\n                  ","id":"task_gpl_5l4_jp","href":"TA_Help\/Topics\/ug_Zephyr_importing_Zephyr_test_cases.html","menu": {"hasChildren":false,},"tocID":"task_gpl_5l4_jp-d46e25779","topics":[]},{"title":"Uploading <span class=\"ph\">TestArchitect</span> test modules\/test cases to Zephyr\n                  ","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> test cases and test modules can be         uploaded to the Zephyr server, which also establishes one-to-one mappings between\n                        the two         sets of test cases.\n                     </p>\n                  ","id":"task_nk3_n44_jp","href":"TA_Help\/Topics\/ug_Zephyr_upload_TA_TM_TC.html","menu": {"hasChildren":false,},"tocID":"task_nk3_n44_jp-d46e25795","next":"task_nk3_n44_jp-d46e25795",},{"title":"Mapping <span class=\"ph\">TestArchitect</span> test cases to Zephyr test cases\n                  ","shortdesc":"\n                     <p class=\"shortdesc\">Mappings between <span class=\"ph\">TestArchitect</span> and Zephyr test         cases are generated automatically when Zephyr test cases are imported to <span class=\"ph\">TestArchitect</span>, and when <span class=\"ph\">TestArchitect</span> test cases are uploaded to Zephyr. There         may be occasions, however, when you need to create a linkage between test\n                        cases created         independently on the two systems.\n                     </p>\n                  ","id":"task_otr_pt3_jp","href":"TA_Help\/Topics\/ug_Zephyr_mapping_test_cases.html","menu": {"hasChildren":false,},"tocID":"task_otr_pt3_jp-d46e25825","topics":[]},{"title":"Mapping TestArchitect test modules to Zephyr test cases","shortdesc":"\n                     <p class=\"shortdesc\">Apart from TestArchitect test cases, you can map TestArchitect test modules to Zephyr         test cases.</p>\n                  ","id":"Zephyr_mapping_TM","href":"TA_Help\/Topics\/Zephyr_mapping_TM.html","menu": {"hasChildren":false,},"tocID":"Zephyr_mapping_TM-d46e25848","topics":[]},{"title":"Uploading <span class=\"ph\">TestArchitect</span> test results to Zephyr\n                  ","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> test results from test projects which are   mapped to Zephyr can be uploaded to Zephyr manually or automatically.\n                     </p>\n                  ","id":"concept_mbq_qr4_jp","href":"TA_Help\/Topics\/ug_Zephyr_uploading_results.html","menu": {"hasChildren":false,},"tocID":"concept_mbq_qr4_jp-d46e25859","next":"concept_mbq_qr4_jp-d46e25859",},{"title":"Executing tests from Zephyr","shortdesc":"\n                     <p class=\"shortdesc\">As an alternative to executing tests from <span class=\"ph\">TestArchitect</span>, <span class=\"ph\">TestArchitect</span> test cases and test modules may be executed         from Zephyr.\n                     </p>\n                  ","id":"task_dgc_ysv_jp","href":"TA_Help\/Topics\/ug_Zephyr_executing_tests.html","menu": {"hasChildren":false,},"tocID":"task_dgc_ysv_jp-d46e25919","topics":[]},{"title":"Creating matching custom fields in <span class=\"ph\">TestArchitect</span> and Zephyr\n                  ","shortdesc":"\n                     <p class=\"shortdesc\">User-defined             fields in <span class=\"ph\">TestArchitect</span> are automatically mapped to             Zephyr custom fields when the names and data types match.\n                     </p>\n                  ","id":"task_qdv_bvv_jp","href":"TA_Help\/Topics\/ug_Zephyr_creating_custom_fields.html","menu": {"hasChildren":false,},"tocID":"task_qdv_bvv_jp-d46e25936","topics":[]},{"title":"Rules for mapping custom fields between TestArchitect and Zephyr","shortdesc":"\n                     <p class=\"shortdesc\">Custom test case fields in Zephyr can be mapped to user-defined fields in <span class=\"ph\">TestArchitect</span> test modules or test cases.\n                     </p>\n                  ","id":"concept_mp5_3yv_jp","href":"TA_Help\/Topics\/ug_Zephyr_matching_custom_fields.html","menu": {"hasChildren":false,},"tocID":"concept_mp5_3yv_jp-d46e25953","topics":[]}]});